def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""
    words = input1.split(' ')
    result = []
    for word in words:
        parts = word.split('-')
        if len(parts) > 1:
            word_result = parts[0] + ''.join(part.capitalize() for part in parts[1:])
        else:
            word_result = word
        result.append(word_result)
    return ' '.join(result)
